package com.nmims.app.Models;public class NotificationDataModel{    private String not_id;    private String playerId;    public NotificationDataModel() {    }    public NotificationDataModel(String not_id, String playerId) {        this.not_id = not_id;        this.playerId = playerId;    }    public String getNot_id() {        return not_id;    }    public void setNot_id(String not_id) {        this.not_id = not_id;    }    public String getPlayerId() {        return playerId;    }    public void setPlayerId(String playerId) {        this.playerId = playerId;    }}